import React from "react";
import "./Slider.css";
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from "react-responsive-carousel";

import videocall from '../IMGS/videocall.jpeg';
import main from '../IMGS/main.jpeg';
import mainmini from '../IMGS/mainmini.jpeg';

function Slider() {
  return (
    <Carousel>
      <div>
        <img src={main}/>
      </div>
      <div>
        <img src={mainmini}/>
      </div>
      <div>
        <img src={videocall}/>
      </div>
    </Carousel>
  );
}

export default Slider;
